import React from "react";
import { createContext } from "react";

export const userContext = createContext({
    user: null,
    logIn: () => {},
    logOut: () => {} 
});

export function userContextProvider({ children }) {
    return (
        <userContext.Provider value={{}}>
            { children }
        </userContext.Provider>
    );
}
